import React from "react";
import "./Video.css";

const Video = () => {
  return (
    <div className="video">
      <video
        className="video_player"
        loop
        src="https://v16m.tiktokcdn.com/45530d13a76918eeb276d6d6aa672d0b/5f538525/video/tos/useast2a/tos-useast2a-pve-0068/c657fb2c5ff24732a242da9e00746bda/?a=1233&br=1742&bt=871&cr=0&cs=0&cv=1&dr=0&ds=3&er=&l=2020090506312401019018515905079F7F&lr=tiktok_m&mime_type=video_mp4&qs=0&rc=ajZnNmYzO3htdjMzNzczM0ApNjRoOztmZmQzNzc3OWU5NWdrL3ByMmdpM2hfLS0yMTZzczA2YC8yMTIwNDYvLmNeXzI6Yw%3D%3D&vl=&vr="
      ></video>
    </div>
  );
};

export default Video;
